“LA REALEZA” 👠✨

@alejoavilaa_  @roberto.afp 

📸: @fpc.sessions

Si , estos son los pequeños talentosos que a sus 14 añitos ya me ayudaban a dirigir, coreografíar y ensayar como asistentes todos los proyectos de televisión, proyectos como “La Academia  Kids 1 y 2” “Mexico Baila”, “Baila si puedes”  de TV Azteca e infinidad de artistas… 
Gracias por permitirme ser parte de su proceso y por confiar en mi para llevarlos al límite y hacerlos los mejores bailarines que pueden ser 💜 
No me cabe en el pecho la emoción de volvernos a juntar y vivir y gozar de esto que hicimos hoy 🎥  es un momento que jamás voy a olvidar y que se quedará en mi corazón por siempre… 
Sigan luchando por sus sueños , yo siempre estaré para ustedes… 🫰🏻

